import React from 'react'
import { Thumbnail, Header2 } from './StyledElements'




export default function ({ projects }) {
    return (
        <div>

            {projects.map(project => (
                <div>
                    <Header2>{project.title}</Header2>
                    {project.description}
                    <Thumbnail src={project.imageURL}/>
                </div>
            ))}
        </div>
    )
}
